const Cabinet = () => {
	return (
		<div className="content">
			Cabinet
			<div className="cabinet_form">
				<div className="row">
					<label>First name</label>
					<input type="text"/>
				</div>
			</div>

		</div>
	);
};

export default Cabinet;
